import BotonAgregar from "../componentes/BotonAgregar";

const Cocheras = () => {
    return (
        <div className="container-fluid mt-4">
            <div className="d-flex justify-content-between align-items-center mb-3">
                <h2 className="fw-bold">Gesti√≥n de Cocheras</h2>
                <BotonAgregar texto="Asignar Nueva Cochera" />
            </div>
            <FiltrosCocheras />
            <TablaCocheras />
        </div>
    );
};

export default Cocheras;
